import React from "react";
import { Container, Row } from "react-bootstrap";

import { CardConfig } from "../config/CardConfig"; 

import Card from '../components/Card'
import Fisico1 from '../img/fisico1.png';
import Digital1 from '../img/digital1.png';

{/* <Row style={{ display: 'flex', justifyContent: 'space-around', padding: '20px' }}>
<Card Titulo='Convite de casamento' Texto='R$ 3,00 Un.' Img={Fisico1} />
<Card Titulo='Convite de casamento' Texto='R$ 3,00 Un.' Img={Fisico1} />
<Card Titulo='Convite digital' Texto='R$ 25,00' Img={Digital1} />
</Row> */}
export default Index => {
    return (
        <div>
            {CardConfig().map(x=>{
                return (
                    <div>
                        <Card Titulo={x.Titulo} Texto={x.Texto} Img={x.Img} />
                    </div>
                );
            })}
        </div>
    );
}
